"""
2147  10^999999+308267*10^292000+1     1000000 CH10  2021
https://t5k.org/primes/lists/all.txt
"""
from time import time
from gmpy2 import mpz  # pylint: disable=no-name-in-module
import cypari2

p = mpz(10 ** 999999 + 308267 * 10 ** 292000 + 1)
print(len(str(p)), "-digit prime p (", len(str(f'{p:b}')), " bits)")

sqrtm1 = mpz("")
assert  sqrtm1**2 % p == p - 1

pari = cypari2.Pari(); pari.allocatemem(1000000000)

print("[M,V] = pari.halfgcd(sqrtm1, p)")
t = time(); [M,V] = pari.halfgcd(sqrtm1, p);  print(f'{1000*(time()-t):.1f}ms')

print("[x,y] = [mpz(V[1]), mpz(M[1,0])]")
t = time(); [x,y] = [mpz(V[1]), mpz(M[1,0])]; print(f'{1000*(time()-t):.1f}ms')
assert x**2 + y**2 == p

print("sqrtm1 = x * pow(y, -1, p) % p")
t = time(); sqrtm1 = x * pow(y, -1, p) % p;   print(f'{1000*(time()-t):.1f}ms')
assert sqrtm1**2 % p == p - 1
print("done, all asserts OK")
